public class Solution {
    public long CountInterestingSubarrays(IList<int> nums, int modulo, int k) {
        long count = 0;
        for (int i = 0; i < nums.Count; i++) {
            int cnt = 0;
            for (int j = i; j < nums.Count; j++) {
                if (nums[j] % modulo == k) cnt++;
                if (cnt % modulo == k) count++;
            }
        }
        return count;
    }
}
